description:
Tous les établissements de santé sont concernés par la lutte contre les infections nosocomiales. Les sept indicateurs qui constituent le tableau de bord des infections nosocomiales en 2011 sont les suivants :
1° Un indicateur général sur la lutte contre les infections nosocomiales : l’indicateur composite des activités de lutte contre les infections nosocomiales (ICALIN.2). L’ICALIN.2 objective l’organisation de la lutte contre les infections nosocomiales dans l’établissement, les moyens mobilisés et les actions mises en œuvre ;
2° Un indicateur spécifique sur l’hygiène des mains : l’indicateur de consommation de solutions hydro-alcooliques pour l’hygiène des mains : ICSHA.2. L’indicateur ICSHA.2 est un marqueur indirect de la mise en œuvre effective de l’hygiène des mains, une mesure-clé de prévention de nombreuses infections nosocomiales ;
3° Un indicateur spécifique sur le risque infectieux opératoire : l’indicateur composite de lutte contre les infections du site opératoire (ICA-LISO). L’indicateur ICA-LISO rend visible l’engagement de l’établissement dans une démarche d’évaluation et d’amélioration des pratiques et de maîtrise du risque infectieux en chirurgie.
Trois indicateurs complémentaires pour mieux lutter contre les bactéries multi-résistantes :
4° L’indice composite de bon usage des antibiotiques (ICATB). L’ICATB reflète le niveau d’engagement de l’établissement de santé, dans une stratégie d'optimisation de l'efficacité des traitements antibiotiques.
5° L’indicateur composite de maîtrise de la diffusion des bactéries multi-résistantes (ICA-BMR). L’ICA-BMR rend visible le niveau d’engagement de l’établissement de santé, dans une démarche visant à maitriser la diffusion des bactéries multi-résistantes dans leur ensemble.
6° L’indice triennal du SARM permet de refléter l’écologie microbienne du Staphylococcus aureus (staphylocoques dorés) résistant à la méticilline (SARM) de l’établissement et sa capacité à la maîtriser par des mesures de prévention de la transmission de patient à patient et par une politique de maîtrise des prescriptions d’antibiotiques. Cette bactérie multi-résistante aux antibiotiques est fréquemment en cause dans les infections nococomiales.
7° Une agrégation des indicateurs pour une vision globale : le score agrégé. La prévention des infections nosocomiales est un sujet complexe qui nécessite la mise en œuvre de nombreuses stratégies complémentaires. Seule l’interprétation de plusieurs indicateurs permet d’avoir une vision plus complète du niveau d’engagement des établissements de santé dans ce domaine. C’est pourquoi le score agrégé activités 2011 a été construit à partir des 5 indicateurs composites (ICALIN.2, ICSHA.2, ICA-LISO, ICATB et ICA-BMR) différents selon le type et l’activité des établissements. Par exemple, ICA-LISO ne concerne que les établissements de santé ayant une activité de chirurgie, ou d’obstétrique.
Pour chaque catégorie, les établissements concernés ont été répartis en 5 classes de performance de A à E :
- la classe A est composée des établissements ayant les scores les plus élevés. Ce sont les structures les plus en avance selon l’indicateur ;
- la classe E réunit les établissements ayant les scores les moins élevés. Ce sont les structures les plus en retard selon l'indicateur ;
- les classes B, C et D correspondent à des établissements en situation intermédiaire.

L’Indicateur alternatif de Participation des Femmes à la vie politique et économique (IPF-a), défini par Jean Gadrey en 2006, est un indicateur synthétique très proche de celui du PNUD.  
Cet IPF-a est la moyenne de trois indicateurs compris entre 0 et 1, à savoir :  
\- pour la parité politique, le pourcentage de femmes au Parlement divisé par 50 ;  
\- pour la parité dans l’accès aux deux groupes de professions 1 et 2 définies par le PNUD, l’indicateur est la somme du pourcentage de femmes dans le groupe 1 et de leur pourcentage dans le groupe 2 ;  
\- pour la parité dans l’accès au revenu du travail, ce sera le rapport du revenu par femme au revenu par homme, selon les définitions du PNUD.  
Plus l’IPF-a se rapproche de 1, plus la parité est respectée selon les 3 critères retenus dans l’indicateur synthétique.
